import React from 'react';
import { Typography, Container, Box, Paper, Grid, List, ListItem, ListItemText } from '@mui/material';

const Experience = () => {
  const experiences = [
    {
      title: "Senior Software Engineer",
      company: "TechCorp",
      startDate: "June 2022 - Present",
      points: [
        "Led a team of 5 developers in building scalable microservices using Java and Spring Boot",
        "Implemented CI/CD pipelines using Jenkins and Docker",
        "Optimized database queries to improve application performance by 30%",
        "Mentored junior developers and conducted code reviews",
        "Developed RESTful APIs following clean architecture principles"
      ]
    },
    {
      title: "Software Engineer",
      company: "InnovateTech",
      startDate: "Jan 2020 - May 2022",
      points: [
        "Contributed to the development of a high-performance distributed system",
        "Implemented caching strategies using Redis to reduce latency",
        "Worked with Kafka for real-time data streaming",
        "Participated in agile sprints and daily stand-ups",
        "Developed automated testing frameworks using JUnit and Mockito"
      ]
    }
  ];

  return (
    <Container maxWidth="md" sx={{ mt: 8, mb: 8 }}>
      <Paper sx={{ p: 4 }}>
        <Typography variant="h4" component="h1" gutterBottom align="center">
          Experience
        </Typography>
        {experiences.map((exp, index) => (
          <Box key={index} sx={{ mb: 4 }}>
            <Typography variant="h5" gutterBottom>
              {exp.title} at {exp.company}
            </Typography>
            <Typography variant="subtitle1" color="text.secondary" gutterBottom>
              {exp.startDate}
            </Typography>
            <List>
              {exp.points.map((point, i) => (
                <ListItem key={i} disablePadding>
                  <ListItemText primary={point} />
                </ListItem>
              ))}
            </List>
          </Box>
        ))}
      </Paper>
    </Container>
  );
};

export default Experience;
